DROP TABLE IF EXISTS `members`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `members` (
  `id` char(36) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `member_code` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Format: LCH001, LCH002, etc.',
  `name` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `occupation` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `date_of_birth` date NOT NULL,
  `baptism_status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '1=Baptized, 0=Not Baptized',
  `confirmation_status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '1=Confirmed, 0=Not Confirmed',
  `marital_status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '1=Married, 0=Unmarried',
  `residential_status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '1=Resident, 0=Non-Resident',
  `aadhar_number` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Encrypted in application layer',
  `mobile` varchar(15) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `address` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci,
  `area` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `ward` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `remarks` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci,
  `member_status` enum('confirmed','unconfirmed','suspended') CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'unconfirmed',
  `password` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Bcrypt hashed password',
  `registration_date` date NOT NULL,
  `last_login` datetime DEFAULT NULL,
  `failed_login_attempts` int NOT NULL DEFAULT '0',
  `locked_until` datetime DEFAULT NULL,
  `created_by` char(36) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Admin user ID who created this member',
  `created_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `family_id` int DEFAULT NULL COMMENT 'From CSV MemberSerialNum',
  `member_order` int DEFAULT NULL COMMENT 'From CSV FamilySerialNum',
  `head_of_family` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'From CSV Address1',
  `member_serial_num` int DEFAULT NULL COMMENT 'From CSV MemberSerialNum (Explicit)',
  PRIMARY KEY (`id`),
  UNIQUE KEY `member_code` (`member_code`),
  KEY `idx_member_code` (`member_code`),
  KEY `idx_mobile` (`mobile`),
  KEY `idx_name` (`name`),
  KEY `idx_member_status` (`member_status`),
  KEY `idx_registration_date` (`registration_date`),
  KEY `idx_date_of_birth` (`date_of_birth`),
  KEY `idx_area_ward` (`area`,`ward`),
  KEY `created_by` (`created_by`),
  KEY `idx_members_status_registration` (`member_status`,`registration_date`),
  FULLTEXT KEY `ft_member_search` (`name`,`occupation`,`address`),
  CONSTRAINT `members_ibfk_1` FOREIGN KEY (`created_by`) REFERENCES `admin_users` (`id`) ON DELETE SET NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Church members database';
/*!40101 SET character_set_client = @saved_cs_client */;

